import React from 'react';
import { Switch, Route } from 'react-router-dom';

import {
    SignIn as SiginView
} from './views';

const Routes = () => {
    return (
        <Switch>
            <Route exact path="/sigin">
                <SiginView />
            </Route>
        </Switch>
    )
}

export default Routes;
